import React from 'react';
import Form from './Form';

class Post extends React.Component {
  state = {
    names: []
  }

  addPost = (event) => {
    console.log('HIT!')
  }

  render() {
    return (
      <div>
        <Form props={this.state.names} />
      </div>
    )
  }
}

export default Post;
